import React from 'react';
import './list-service.css'


class ListServicos extends React.Component{
    render(){
        return (
            <div className='list-services'>
                <a className='product'>
                    <span className='product-title'> Serviço 01 </span>

                    <h4 className='product-title'> Serviço 01 </h4>
                </a>

                <a className='product'>
                    <span className='product-title'> Serviço 02 </span>
                </a>
                <a className='product'>
                    <span className='product-title'> Serviço 03 </span>
                </a>
            </div>

        )
    }
}

export default ListServicos;
